import React from 'react';
import './styles.css'

import Logo from '../../assets/logo.svg'

import Footer from '../../components/Footer'

function Publicacao() {
  return (
    <>

      <Link to="/">
        <img className="logo-login" src={Logo} alt="logo, get car"/>
      </Link>

    <Footer/>
    </>
  )
}
export default Publicacao;
